import React from "react";

const MyState = () => {
  const [myName, helloWorld] = React.useState("ㅇㅇ");
  const [myPoint, setMyPoint] = React.useState(50);

  return (
    <div>
      <h2>MyState</h2>
      <h3>
        {myName || "이름없음"} 님의 점수는 {myPoint} 입니다.
      </h3>
    </div>
  );
};

export default MyState;
